		"text": "\"실은 ‘데모크라시’라는 말 자체가 번역이 잘못됐다. 데모크라시는 데모+크라시, 즉 민중에 의한 정부다. 여기서 크라시는 통치 체제, 즉 정부를 말한다. 그런데 이 말을 일본사람들이 ‘민주주의’로 번역했다.\"",
