		"text": "\"그동안 많은 역사가들은 카가 주창한 과학적 역사학이라는 벽에 부닥쳐 일반인들에게 쉽게 접근할 수 없었다. 카는 “역사는 현재와 과거의 끊임없는 대화다”라고 말했지만 그 대화는 지식/권력 관계 안에서만 이루어지는 일방적인 대화에 불과했다.\"",
