		"text": "\"오늘날에는 젠더·인종·종교·성적 취향에 근거한 새로운 형태의 갈등이 시급한 문제로 떠올랐고, 이런 갈등을 해결할 새로운 역사이론이 필요하게 되었다. 40여 년 전 카가 제시한 탁월한 역사이론이 오늘날 이런 갈등을 해결할수있는 방법론을제시할수있을까?\"",
