		"id_str": "799039831477129216",
		"text": "근데 Constructivism의 번역이 난망하네요. 일본어권에선 구축주의로 번역되는 반면, 한국어권에서는 주로 구성주의로 번역되는데, 학적 맥락에 따라 구성주의는 일반적으로 구조주의로 번역되는 Structuralism의 번역어로 택해질 때도 있고,",
