			"id_str": "798525264355393537",
			"text": "이미 아는 사람들은 다 아는 유명한 얘긴데 드라마 광팬이라죠. 말 그대로 줄줄이 꿰차고 있어서 얘기 나눠 보면 깜짝 놀랄 수밖에 없대요. 일과 후엔 언제나 드라마를 봐요. 그러니 건드리지 말아요. #주어는_없어요. #길라임_미안해요",
