		"text": "모에화는 대상에서 플랫한 일면을 추출하여 과장(데포르메)하는 과정(化)이고, 그런 이상 오타쿠 문화권에서 캐릭터 조형은 개별성(특수성)보다 일반성(스테레오 타입)에 의존하게 돼요. 다만 그럼에도 고유명 논의에서 보듯, 캐릭터는 단독성을 띠게 되는 것.",
