				"text": "&lt;미국에서 민란이 발생했다.&gt;아웃사이더 민란군이 백악관을 점령했다. 제도권 주류사회의 카르텔을 민초들이 균열을 냈고 트럼프가 그 중심에 섰다. 주류 언론의 트럼프 죽이기도 통하지 않았다. 트럼프 자서전 \"거래의 기술\"로 보면 그는 철저한 이익중심자다.",
