		"id_str": "795604025030754304",
		"text": "\"ilbe닷컴 도메인은 2000년 8월~2011년 1월말까지 내내 사용되지 않고 ‘닫힌’(locked) 상태였다. 그러다가 2011년 2월15일 ‘Michael Park’이 도메인 점유권을 양도받고 도메인이 활성(active) 상태로 바뀐다.\"",
