		"id": 795603572599636000,
		"id_str": "795603572599635969",
		"text": "“많이 다르다. 제가 있을 땐 정치적인 글들이 관리가 됐는데 지금 일베 운영자들이 (과하게 정치적인 글을) 이용하는 것 같다. 추천·비추천 버튼도 산업화·민주화로 (현재 운영진이) 바꾼 거다. 내가 만든 일베 저장소는 산업화·민주화 버튼이 아니었다.”",
