		"text": "\"당시 커뮤니티 사이트의 흐름이라든가. 트래픽이 늘었다. 사이트를 개선하고 업그레이드하려고 2010년 4월 잠시 닫았다. 그런데 한달쯤 뒤 어느 날 디시인사이드 일간베스트 게시물을 모아놓은 ‘일베개라지’(ilbegarage) 사이트가 생겼다.\"",
