		"id_str": "794204492409360384",
		"text": "\"평론가들이 GV로 몰려가며 담론도 부서져 나간다. 지면 비평은 불특정 다수 독자에게 공개되고 공론장에 색인이 남는다. 담화 비평은 폐쇄된 장소에서 소수의 특정한 청중을 대상으로 발화된 후 사라진다.\"",
