		"text": "\"신앙은 원래 진리로의 참여이다. 하지만 그러한 신앙은 허용될 수 없다. 진리는 정의상 보편적이며 따라서 배타적이기 때문이다. \"나는 당신이 이슬람교를 믿는 것을 인정합니다. 단 사적인 취미라고 한다면\"이라는 것이다.\"",
