		"id": 793856897958879200,
		"id_str": "793856897958879233",
		"text": "\"다문화주의자가 다양한 문화나 신앙이 심각한 갈등을 야기하는 일 없이 하나의 사회 공간 안에 평화롭게 공존할 수 있다고 소박하게 전제할 수 있는 것은 왜인가? 다문화주의가 문화와 신앙을 사적인 취미와 같은 것으로 간주하고 있기 때문이다.\"",
