		"id": 793848692960665600,
		"id_str": "793848692960665600",
		"text": "정확히는, 선후가 다르기에 '그럼에도'가 아니게 될 테죠. 이것이 아즈마와의 차이가 되고. '마음의 안식처로 삼았지만 그 신이 허구라는 사실을 알고 있다'. 대상과 자연히 간극이 생겨 균형이 성립하고. '아이러니한 몰입'이 아닌, '자연스러운 간극'.",
