		"id": 793845831002579000,
		"id_str": "793845831002578944",
		"text": "적어도 그 신이 '허구'라는 사실을 알고 있는 것. 그럼에도 마음의 안식처로 삼는 것. 이것이 오타쿠, 정확히는 저 자신의 윤리고, 의사초월성과 아이러니라는 키워드는 아즈마의 언설을 연상하게 할지 모르나 맥락과 그 좌표는 전혀 다르네요.",
