		"id": 793446521173749800,
		"id_str": "793446521173749760",
		"text": "요즘 대입은 수시 비중이 80%에 육박한다고 해서 깜짝 놀라서 찾아보니까 수능이 원래 취지와 다르게 성취도 평가로 변질돼서 망한 탓이었네요. 어차피 본질은 똑같아졌으니까 정시에서 내신도 안 보는 듯하고.",
